import Box from "@material-ui/core/Box";
import Typography from "@material-ui/core/Typography";

const useStyles = makeStyles(theme => ({
  root: {
    flexGrow: 1
  },
  paper: {
    padding: theme.spacing(2),
    textAlign: "center",
    color: theme.palette.text.secondary
  }
}));

const FavLegend = props => {
  const classes = useStyles();

  return (
    // <Grid className={classes.root} item xs={3}>
    <Typography component="div">
      <div className="favLegendBox">
        <box
          className="imageTitle"
          fontFamily="Arial"
          m={1}
          style={{ display: "block" }}
        >
          {props.title}
        </box>
        <box
          className="imageOwner"
          fontFamily="Arial"
          m={2}
          style={{ display: "block" }}
        >
          {props.owner}
        </box>
        <box
          className="imageDate"
          fontFamily="Arial"
          m={3}
          style={{ display: "block" }}
        >
          {props.date}
        </box>
        <box
          className="stats"
          fontFamily="Arial"
          m={4}
          style={{ display: "block" }}
        >
          <span>Views: {props.stats.views}</span>
          <span>Favorites: {props.stats.favorites}</span>
          <span>Comments: {props.stats.comments}</span>
        </box>
      </div>
    </Typography>
